import React from "react";
import BasicItemsPage from "./BasicItemsPage";

import mealImage from "../images/Burger_Fries.png";

const MealPage = () => {
  return(
    <div>
      <div className="page-container">
        <BasicItemsPage displayInfo={displayInfo}/>
      </div>
    </div>
  );
}

const displayInfo = [
  {
    title: "Southern Fried Chicken",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Road-Side Burger",
    image: mealImage,
    url: "/sides"
  },
  {
    title: "Srimp Crits",
    image: mealImage,
    url: "/drinks"
  },
  {
    title: "Desserts",
    image: mealImage,
    url: "/desserts"
  }
];

export default MealPage;
